import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

//MovieList component
const MovieList = (props) => (
  <div>
    {props.children}
  </div>
)

render(
  <MovieList>
    <ul>
      <li>Breaking Bad</li>
      <li>Narcos</li>
      <li>Game of Thrones</li>
    </ul>
  </MovieList>
)

//export default App;
